//
//  Test Description: Pointer Chasing Network Stress Test.
//
//  A cyclic linked list is compiled into the binary, and loaded into DRAM. Each tile starts at a different position in the linked list, and iterates until it returns to its initial position.
//  This generates random network traffic to the vcaches, and congestion in the network or vcache contention (depending on the size of the manycore array).
//
//  The linked list is a static linked list of 4096 nodes. The correctness of the code is dependent on the array being aligned with the start of the .dram section (i.e. nothing should be declared in .dram before the data array)
//
//  The tiles synchronize using a barrier when complete.
//
//  The program loads the "key" associated with linked list node. If the key matches the tile id, the program exits the main loop.
//  (data is arranged so that every tile needs to traverse the list equal number of times)
//
//  Explain the assumptions in the code (dram, the stop condition).
//  A: this works for machine any power-of-2 machine size that is less than 128 tiles total.
//

