void pointer_chase()
{
    
  int my_id = __bsg_id;
  Node* ptr = &data[(my_id*(N/NUM_TILES))%N];

  int key1 = -1;
  int key2 = -1;

  do {
    Node* next = (Node*) ptr->next;
    key1 = ptr->key; 
    key2 = next->key;
    ptr = (Node*) next->next;
  } while ((key1 != my_id) && (key2 != my_id));
}




